import { createRouter, createWebHistory } from 'vue-router'

import home from '../pages/home'
import crud from '../pages/crud'
import App from '../App'

const routes = [

  {
    name:'Home',
    path:'/home',
    component:home
  },
  {
    name:'Crud',
    path:'/crud',
    component:crud
  },

];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
